  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is one component of a digital
  orthophoto coverage (DOI) over the Southwest Florida Water Management District (SWFWMD
  contract B089) area. This dataset is comprised of 4-band 32bit (red, green, blue,
  and infrared bands) DOI cells in a GeoTIFF format, at a 1-foot pixel resolution,
  based on the District's 5,000' x 5,000' tile system. This dataset was created from
  source imagery acquired through the Leica ADS40 multispectral scanner from December
  22, 2008 through January 22, 2009. The companion dataset to this coverage includes
  a dataset comprised of the original imagery mosaic lines with dates of imagery acquisition
  in the ESRI shapefile format.\",\n\t\"owner_org\": \"b0b4c45b-a8ca-416b-b463-ee90d0a1a3df\",\n\t\"extras\":
